text = ""
skew = 0
    # tracks the current skew value when iterating through the list
skewRecord = []
    # creates a list of all skew values throughout the progression of the loop
min = 0
    # tracks the smallest value of the skew
# max = 0
    # tracks the highest value of the skew

for i in text:
    if (i == "G"):
        skew += 1
    if (i == "C"):
        skew -= 1
    #if (skew > max):
    #    max = skew
    if (skew < min):
        min = skew
    skewRecord.append(skew)

minimizingSkew = []
count = 0
for i in skewRecord:
    count += 1
    if (i == min):
        minimizingSkew.append(count)

stringInts = [str(i) for i in minimizingSkew]
parse = " ".join(stringInts)
print(parse)